column13:
A saw comprising: 
a table (11); 
a base (2) supporting the table, comprising a panel (13); 
a saw assembly pivotably connected to at least one of the table and the base for carrying a rotatable cutting tool (14) so that the tool protrudes through and above the table, at least part of the saw assembly being underneath the table, 
an adjustment shaft (232) supported by the saw assembly and protruding from the panel, the shaft having a worm gear (231) at one end and threads (232T) near the other end; 
a locking knob (15L) threadingly engaged to the shaft; and 
a crank (15C) connected to the shaft and disposed between the locking knob and the saw assembly.

A saw comprising: 
a table (11); 
a base (2) supporting the table, comprising a panel (13); 
a saw assembly pivotably connected to at least one of the table and the base for carrying a rotatable cutting tool (14) so that the tool protrudes through and above the table, at least part of the saw assembly being underneath the table, 
an adjustment shaft (232) supported by the saw assembly and protruding from the panel, the shaft having a worm gear (231) at one end and threads (232T) near the other end; 
a locking knob (15L) threadingly engaged to the shaft; and 
a crank (15C) connected to the shaft and disposed between the locking knob and the saw assembly.

A saw comprising: 
a table (11); 
a base (2) supporting the table, the base comprising a front panel (13) with a slot (17); 
a saw assembly pivotably connected to at least one of the table and the base for carrying a rotatable cutting tool (14) so that the tool (14) protrudes through and above the table (11), at least part of the saw assembly being underneath the table (11); 
one of the panel (13) and the saw assembly supporting a fixed stop (155) and the other of the panel and the saw assembly supporting a movable stop (11B,301) movable between a first position bypassing the said fixed stop (155) and a second position contacting the said fixed stop (155).
